import React,{Component} from 'react';
import  ServiceCatagories from '../Components/ServiceCatagories';
import FamousServices from '../Components/FamousServices';
import Feedbacks from '../Components/Feedbacks';
import Footer from '../Components/Footer';
import SiteIntro from '../Components/SiteIntro';
import AddFeedback from '../Components/AddFeedback';
import axios from 'axios';

class SubMainScreen extends Component{
	state={
		'login':this.props.login,
	}

	handleChooseCatagory(id){
		alert('Opening'+id);
	}

	handleOpenService(id){
		alert(id);
	}


	componentDidMount(){
		axios.get('http://127.0.0.1:8000/mainPageData/').then(res=>{
			this.setState(res.data);
		}).catch(err=>console.error(err))
	}

	componentWillUpdate(){
		const user = localStorage.getItem('user223');
		if((user===null) || (user==='')){
			this.setState({'login':false});
		}else{
			this.setState({'login':true});

		};
	}


	render(){
		return(
			<div>
				{this.state.ServiceCatagories?<div>

					{this.state.login?'':<SiteIntro/>}

					<ServiceCatagories
					 data={this.state.ServiceCatagories}
					 handleChooseCatagory={this.handleChooseCatagory}
					/>

					<FamousServices data={this.state.Plans[0].PlanServices} handleOpenService={this.handleOpenService}/>

					<Feedbacks data={this.state.FrontPageFeedback}/>
					{this.state.login?<AddFeedback/>:<h4>You can give feedback after signup/login.</h4>}
					<hr/>
					<Footer/>

				</div>:<div></div>}
			</div>
		)
	}
}

export default SubMainScreen;
